import logo from './logo.svg';
import './App.css';
import {store} from "./actions/store";
import { Provider } from "react-redux";
import Employee from './components/Employee';

function App() {
  return (
    <Provider store={store}>
      <Employee/>
    </Provider>
  );  
}

export default App;
